if (!SecMasking) begin
           prng_reseed_done_d = 1'b0;
           aes_ctrl_ns        = CTRL_PRNG_RESEED;
         end else begin

if (cipher_in_ready_i) begin
  prng_reseed_done_d = 1'b0;
  aes_ctrl_ns        = CTRL_PRNG_RESEED;
end

if (prng_reseed_done_q) begin
  // Clear the trigger and return.
  prng_reseed_we     = 1'b1;
  prng_reseed_done_d = 1'b0;
  aes_ctrl_ns        = CTRL_IDLE;
end

if (cipher_out_ready_o && cipher_out_valid_i) begin
  // Clear the trigger and return.
  prng_reseed_we     = 1'b1;
  prng_reseed_done_d = 1'b0;
  aes_ctrl_ns        = CTRL_IDLE;
end
